import {Link} from 'react-router-dom';
import React from 'react'

function Navbar()
{
    return(
        <div>
            <ul>
                <li><Link to="/about">About</Link></li>
                <li><Link to="/">Home</Link></li>
                <li><Link to="/contact">Contact</Link></li>
                <li><Link to="/user">User</Link></li>
                
                            
            </ul>
        </div>
    );
}
export default Navbar;
